const FileData = (props) =>{
    let itemFile = props.file;
    let updatedFile = {}
    for (const record of itemFile){
        console.log(record,record['name'],updatedFile,updatedFile.record['name'])
        if (updatedFile.record['name']){
            console.log(updatedFile[record["name"]])
        }
        else{
            updatedFile.record['name']={
                batch:[record['batch']],
                stock:record["stock"],
                deal:record["deal"],
                free:record["free"],
                mrp:record["mrp"],
                rate:record["rate"],
                exp:record["exp"]
            }
        }
    }
};

export default FileData;
